import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaFacebook, FaLinkedin, FaYoutube, FaLocationDot } from "react-icons/fa6";
import { BsFillTelephoneFill } from "react-icons/bs";
import { MdOutlineMail } from "react-icons/md";
import "./Navbar.css";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [active, setActive] = useState('/');
  const navigate = useNavigate();

  useEffect(() => {
    const handleScroll = () => {
      const navbar = document.querySelector('.navbar');
      if (window.scrollY > 50) {
        navbar.classList.add('scrolled');
      } else {
        navbar.classList.remove('scrolled');
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const handleNavigation = (path) => {
    setActive(path);
    navigate(path);
    setIsOpen(false);
  };

  return (
    <nav className="navbar-container">
      {/* Top Bar */}
      <div className="top-bar">
        <div className="social-icons">
          <a href="http://www.facebook.com" className="icon" aria-label="Facebook"><FaFacebook /></a>
          <a href="http://www.linkedin.com" className="icon" aria-label="LinkedIn"><FaLinkedin /></a>
          <a href="http://www.youtube.com" className="icon" aria-label="YouTube"><FaYoutube /></a>
        </div>

        <div className="contact-info">
          <span className="contact-item">
            <BsFillTelephoneFill /> 
            <span>+94 123456787</span>
          </span>
          <span className="contact-item">
            <FaLocationDot />
            <span>Hapugala, Galle</span>
          </span>
          <span className="contact-item">
            <MdOutlineMail />
            <span>ecolift@gmail.com</span>
          </span>
        </div>
      </div>

      {/* Main Navigation */}
      <div className="main-nav">
        <div className="logo" onClick={() => handleNavigation('/')}>
          ECO LIFT
        </div>
        
        <ul className={`nav-links ${isOpen ? 'open' : ''}`}>
          <li><button className={active === '/' ? 'active' : ''} 
              onClick={() => handleNavigation('/')}>Home</button></li>
          <li><button className={active === '/OurService' ? 'active' : ''} 
              onClick={() => handleNavigation('/OurService')}>Our Services</button></li>
          <li><button className={active === '/AboutUs' ? 'active' : ''} 
              onClick={() => handleNavigation('/AboutUs')}>About Us</button></li>
          <li><button className={active === '/Contact' ? 'active' : ''} 
              onClick={() => handleNavigation('/Contact')}>Contact Us</button></li>
          <li><button className={`login-btn ${active === '/Login' ? 'active' : ''}`} 
              onClick={() => handleNavigation('/Login')}>Login</button></li>
        </ul>

        <div className="menu-icon" onClick={toggleMenu}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
